        "title": "Porsha (Halsey) - Could Have Been Me (Music Video) [Full Movie Scene] Watch Sing 2 Now!!!",
        "description": "Porsha (Halsey) - Could Have Been Me (Music Video)[Full Movie Scene] Watch Sing 2 Now!!!\n\nLyrics: \nDon't wanna live as an untold story\nRather go out in a blaze of glory\nI can't hear you, I don't fear you\nI live now 'cause the bad die last\nDodgin' bullets with your broken past\nWell, I can't hear you, I don't fear you now\n\nWrapped in your regret\nWhat a waste of blood and sweat, oh-oh, oh\n\nI wanna taste love and pain\nI wanna feel pride and shame\nI don't wanna take my time\nI don't wanna waste one line\nI wanna live better days\nNever look back and say\n\"It could have been me, it could have been me\"\nYeah!\n\nDon't wanna wake up on a Monday morning\nThe thought of work is gettin' my skin crawling\nI can't fear you, I don't hear you now\nWrapped in your regret\n\nWrapped in your regret\nWhat a waste of blood and sweat, oh-oh, oh\n\nI wanna taste love (I wanna taste love)\nI wanna feel pride and shame\nI don't wanna take my time (No, oh, oh)\nI don't wanna waste one night (Hey-hey, hey-hey)\nI wanna live better days (Better days)\nNever look back and say\n\"It could have been me\" (It could have been me), \"it could have been me\" (It could have been me)\nI wanna taste love (I wanna taste love and pain)\nI wanna feel pride and shame (I wanna feel pride and shame)\nI don't wanna waste my time (I don't wanna waste my time)\nI don't wanna waste one night (I don't wanna waste one night)\nI wanna live better days\nNever look back and say\n\"It could have been me\", oh, it could have been me\"\nIt could have been me\n\nLook for Sing 2 on Blu-ray, DVD and Digital \n\n#Sing2 in Theaters and On Demand now:\nhttps://www.singmovie.com \n\nFollow Sing: \nhttps://www.instagram.com/singmovie \nhttps://www.facebook.com/SingMovie \nhttps://twitter.com/singmovie \nhttps://www.tiktok.com/@singmovie \n\nThis time Koala Buster Moon wants to present the most extravagant and dazzling stage show ever seen. But big dreams and spectacular hits also call for a bigger stage than the Moon Theater. The Crystal Tower Theater in the glamorous big city would be perfect - but there's one small problem. Actually, three. First, Buster Moon, mother pig Rosita, rocker porcupine Ash, elephant Meena, gorilla Johnny and pop provocateur, pig Gunter, must somehow make it to the office of music mogul Jimmy Crystal and convince the unscrupulous wolf to let them use his theater. It's a hopeless endeavor until Gunter spontaneously promises him the scoop: rock legend Clay Calloway (Bono) will return to the stage for this show! The problem: Buster has never met Clay, a lion who has retired from show business! While Moon's all-star ensemble works to put on the spectacular show, the koala sets out to find Clay. What begins as a dream of great success becomes an emotional reminder of the healing power of music.\n\n© Universal Pictures\n\nBuster Moon, and his all-star cast of performers prepare to launch their most dazzling stage extravaganza yet …all in the glittering entertainment capital of the world. There’s just one hitch: They first have to persuade the world’s most reclusive rock star—played by global music icon Bono, in his animated film debut—to join them.\n \nBuster (Oscar® winner Matthew McConaughey) has turned the New Moon Theater into a local hitbut Buster has his eyes on a bigger prize: Debuting a new show at the Crystal Tower Theater in glamorous Redshore City.\n \nBut with no connections, Buster and his cast—including harried mother pig Rosita (Oscar® winner Reese Witherspoon), rocker porcupine Ash (Scarlett Johansson), earnest gorilla Johnny (Taron Egerton), shy elephant Meena (Tori Kelly) and, of course, porcine provocateur Gunter (Nick Kroll)—have to sneak their way into the world-famous Crystal Entertainment offices, run by ruthless mogul wolf Jimmy Crystal (Emmy winner Bobby Cannavale).\n \nIn a desperate attempt to get Mr. Crystal’s attention, Gunter spontaneously pitches an outrageous idea that Buster quickly runs with, promising that their new show will star lion rock legend Clay Calloway (Bono). Problem is, Buster has never met Clay, an artist who shut himself away from the world more than a decade ago after the loss of his wife. Even worse, Buster has failed to realize that Mr. Crystal is an egocentric gangster who would rather drop somebody off the roof of a building than be lied to.\n \nAs Gunter helps Buster dream up an out-of-this-world theatrical masterpiece, and the pressure (and sinister threats) from Mr. Crystal mount, Rosita’s leading role in the show gets ripped away and handed to Mr. Crystal’s spoiled daughter, Porsha, played by Grammy-nominated artist Halsey. Desperate to save the show, and his life, Buster embarks on a quest to find Clay and persuade him to return to the stage.\n \nWhat begins as a dream of big-time success becomes an emotional reminder of the power of music to heal even the most broken heart.\n \nSing 2 is written and directed by acclaimed returning filmmaker Garth Jennings.\n \n#Halsey #SING2 #Porsha #CouldHaveBeenMe",
